import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import { AuthProvider } from './contexts/AuthContext';
import Home from './pages/Home';
import About from './pages/About';
import Benefits from './pages/Benefits';
import UserTypeSelectionLogin from './pages/UserTypeSelectionLogin';
import UserTypeSelectionRegister from './pages/UserTypeSelectionRegister';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import Layout from './components/Layout';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Layout>
          <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/benefits" element={<Benefits />} />
          <Route path="/user-type" element={<UserTypeSelectionLogin />} />
          <Route path="/register-type" element={<UserTypeSelectionRegister />} />
          <Route path="/login/:userType" element={<Login />} />
          <Route path="/register/:userType" element={<Register />} />
          <Route path="/dashboard/:userType" element={<Dashboard />} />
          </Routes>
        </Layout>
      </Router>
    </AuthProvider>
  );
}

export default App;
